package main

// Out of list of strings, return the Longest one. Return the first one in case of multiple
// strings of the same length. Return nil in case the input list is empty.
// >>> Longest([])
// nil
// >>> Longest(['a', 'b', 'c'])
// 'a'
// >>> Longest(['a', 'bb', 'ccc'])
// 'ccc'
func Longest(strings []string) interface{} {
	if len(strings) == 0 {
		return nil
	}

	longestStr := strings[0] // Initialize with the first string

	for i := 1; i < len(strings); i++ {
		currentStr := strings[i]
		if len(currentStr) > len(longestStr) {
			longestStr = currentStr
		}
	}

	return longestStr
}
